(function () {
    let old = globalThis.sdk_runtime;
    c2_callFunction("execCode", ["globalThis.sdk_runtime = this.runtime"]);
    let runtime = globalThis.sdk_runtime;
    globalThis.sdk_runtime = old;

    let notify = (title, text, image = "./speedrunner.png") => {
        cr.plugins_.sirg_notifications.prototype.acts.AddSimpleNotification.call(
            runtime.types_by_index.find(
                (type) => type.plugin instanceof cr.plugins_.sirg_notifications
            ).instances[0],
            title,
            text,
            image
        );
    };

    let levelSelector = {
        init() {
            document.addEventListener("keydown", (event) => {
                this.keyDown(event)
            });

            this.initDomUI();
            this.levelSelectorWindow = null;

            globalThis.ovoLevelSelector = this;
        },

        initDomUI() {
            let style = document.createElement("style");
            style.type = "text/css";
            style.innerHTML = `
            .ovo-levelselector-button {
                background-color: white;
                border: solid;
                border-color: black;
                border-width: 6px;
                font-family: "Retron2000";
                position: absolute;
                z-index: 3;
                cursor: pointer;
            }

            .ovo-levelselector-button:hover {
                background-color: rgba(200, 200, 200, 1);
            }
            `
            document.head.appendChild(style);

            let toggleButton = document.createElement("button");
            toggleButton.id = "ovo-levelselector-toggle-button";
            toggleButton.innerText = "";

            let loadIcon = document.createElement("img");
            loadIcon.src = "data:image/svg+xml;base64,"
            loadIcon.style.width = "38px";
            loadIcon.style.height = "38px";

            toggleButton.appendChild(loadIcon);
            toggleButton.classList.add("ovo-levelselector-button");
            toggleButton.style.top = "calc(50% + 50px)";
            toggleButton.style.right = "0%";
            toggleButton.style.transform = "translateY(-50%)";
            toggleButton.style.width = "50px";
            toggleButton.style.height = "50px";
            toggleButton.style.zIndex = "3";
            toggleButton.onclick = this.openLevelMenu;
            document.body.appendChild(toggleButton);
        },

        keyDown(event) {
            if (event.code === "KeyT") {
                if (event.shiftKey) {
                    this.openLevelMenu();
                }
            }
        },

        openLevelMenu() {
            if (this.levelSelectorWindow == null || this.levelSelectorWindow.closed) {
                let levelSelector = window.open("", "OvO Level Selector");
                levelSelector.c2_runtime = runtime;

                levelSelector.document.open();
                levelSelector.document.write(`<title>OvO Level Selector</title>`);

                levelSelector.document.write(`
                    <style>
                        @import url('https://fonts.googleapis.com/css2?family=Ubuntu&display=swap');
                    
                        html, head, body {
                            margin: 0;
                            padding: 0;
                        }

                        body {
                            font-family: 'Ubuntu', Verdana, sans-serif;
                            background-color: black;
                            color: white;
                            height: 100%;
                            width: 100%;
                        }
                        
                        .levelselector {
                            width: 100%;
                            height: 100%;
                            float: left;
                        }
                    
                        .levelselector-button {
                            border-radius: 0;
                            border-color: grey;
                            border-width: 2px;
                            color: white;
                            background-color: rgba(255, 255, 255, 0.25);
                            padding: 10px;
                            font-size: 20px;
                            cursor: pointer;
                        }
                    </style>
                `);

                levelSelector.document.write(`<div class="levelselector">`);

                Object.keys(runtime.layouts).forEach((levelName) => {
                    levelSelector.document.write(`<button class="levelselector-button">${levelName}</button>`);
                });

                levelSelector.document.write(`</div>`);

                levelSelector.document.write(`<script>
                    let buttons = document.getElementsByClassName("levelselector-button");
                    for (var i = 0; i < buttons.length; i++) {
                        let button = buttons[i];
                        button.addEventListener("click", () => {
                            window.c2_runtime.changelayout = window.c2_runtime.layouts[button.innerHTML];
                        });
                    }
                </script>`)
                levelSelector.document.close();

                notify("Level Selector", "Window Opened");
            } else {
                notify("Level Selector", "Window Already Opened");
                this.levelSelectorWindow.focus();
            }
        }
    };

    levelSelector.init();
})();